(5, 3, 'Uw persoonlijke vragenlijst'),
(6, 1, '<h3>Welcome on Your Team Assessment, #firstname# #lastname# ,</h3><br />\r\n<p>This online questionnaire measures and assesses the dynamics and the performance level of your team.<br /><br /> \r\nIt comprises 35 questions relating to the behaviour of your team members. <br /> V. Your answers to these questions indicate how frequently your team endorses these behaviours between â€œneverâ€ and â€œalwaysâ€. Your answers remain confidential at all times and are only used to consolidate the results of the questionnaires of the team as a whole.<br /><br />The assessment report that will be sent to your manager after processing draws up the current situation in which your team operates and provides practical ways of improvement.</p>\r\n<h3>Instructions for completing the questionnaire</h3>\r\n<p class=\\"bold\\">This is not a test, there is no right or wrong answer, and your first impression will probably be the best.<br /><br /> \r\nMake sure to find the right time and spot for you to complete the questionnaire spontaneously and without being disturbed, away from any sort of distraction. It should only take about 20 minutes.<br />It is however possible for you to take a break and further complete the questionnaire afterwards. The questionnaire will automatically resume from where you left it.<br /><br /> Complete the questionnaire by responding according to the instructions given above each set of questions.</p>\r\n<p>After each set of questions, you will have to click on <span class=\\"bold\\">\\"Next\\"</span> to proceed to the next screen and to another set of questions.<br />\r\nOnce you have answered a question, you cannot go back. So please pay attention.</p>\r\n<p class=\\"bold\\">We wish you the best of luck!</p>'),
(6, 2, '<h3>Bienvenue Ã  votre questionnaire personnel, #firstname# #lastname# ,</h3><br />\r\n<p>Ce questionnaire en ligne va permettre Ã  votre Ã©quipe dâ€™Ã©valuer sa dynamique de fonctionnement et son niveau de performance.<br /><br /> \r\nIl se compose de 35 questions relatives aux comportements des membres de lâ€™Ã©quipe. <br /> Vos rÃ©ponses Ã©valuent la frÃ©quence de ces comportements entre â€œjamaisâ€ et â€œtoujoursâ€. Elles restent confidentielles et ne sont utilisÃ©es que pour consolider les rÃ©sultats des questionnaires complÃ©tÃ©s par votre Ã©quipe. <br /><br /> Cette consolidation, traduite sous forme de rapport, Ã©tablit un Ã©tat des lieux et fournit des pistes concrÃ¨tes de progression.. Vous Ãªtes invitÃ©(e) Ã  complÃ©ter volontairement le questionnaire.</p>\r\n<h3>Indications pour remplir le questionnaire</h3>\r\n<p class=\\"bold\\">Ceci n\\''est pas un test, il n\\''y a pas de bonne ou de mauvaise rÃ©ponse, et votre premiÃ¨re impression sera probablement la meilleure.<br /><br /> \r\nTrouvez un moment et un lieu au calme pour rÃ©pondre avec spontanÃ©itÃ© et sans interruption, en dehors de toute influence extÃ©rieure. Cela ne devrait pas vous prendre plus de 20 minutes.<br />  Vous avez toutefois la possibilitÃ© de vous arrÃªter; le questionnaire reprendra alors automatiquement lÃ  oÃ¹ vous lâ€™aviez laissÃ©.<br /><br /> Remplissez le questionnaire en rÃ©pondant selon les indications mentionnÃ©es au-dessus des questions.\r\n</p>\r\n<p>Une fois la sÃ©rie de questions complÃ©tÃ©es, cliquez sur le bouton <span class=\\"bold\\">\\"Suivant\\"</span> pour passer Ã  lâ€™Ã©cran suivant et aux autres questions.<br />\r\nIl n\\''est pas possible de revenir en arriÃ¨re. Soyez donc bien attentif.</p>\r\n<p class=\\"bold\\">Bon travail ! Et merci d\\''avance.</p>'),
(6, 3, '<h3>Welkom op Your Team Assessment, #firstname# #lastname# ,</h3><br />\r\n<p>Deze online-vragenlijst maakt het mogelijk om de dynamiek van je team en het prestatieniveau te evalueren.<br /><br /> \r\nZe bestaat uit 35 vragen die het gedrag van de teamleden beschrijven.<br /> Je antwoorden geven de frequentie weer van het gedrag dat je ziet tussen â€œnooitâ€ en â€œaltijdâ€. Alle antwoorden zijn vertrouwelijk en worden enkel gebruikt om de resultaten van de vragenlijsten voor het hele team te synthetiseren.<br /><br />Het syntheserapport dat de leidinggevende na de verwerking krijgt, geeft een momentopname weer en biedt mogelijkheden voor het team om verder te evolueren.</p>\r\n<h3>Aanwijzingen om de vragenlijst in te vullen</h3>\r\n<p class=\\"bold\\">Dit is geen test, er zijn geen goede of slechte antwoorden. Wellicht is je eerste indruk of reactie ook de beste.<br /><br /> \r\nZorg dat je een moment en een plek hebt om rustig en spontaan de vragen te beantwoorden, zonder onderbreking of afleiding. Dit duurt ongeveer 20 min.<br />  Als je toch wil onderbreken om later aan te vullen, kan dat. De vragenlijst gaat dan automatisch verder waar je gestopt bent.<br /><br /> Beantwoord de vragen volgens de indicaties die boven de vragen staan.\r\n</p>\r\n<p>Na elke serie vragen die je beantwoordt, klik je op de knop <span class=\\"bold\\">\\"Volgende\\"</span> om naar het volgende scherm en de volgende vragen te gaan.<br />\r\nje kan niet naar een vraag terugkeren, wees dus voldoende aandachtig.</p>\r\n<p class=\\"bold\\">Veel succes alvast.</p>'),
