(14, 1, 'Your Assessment Team thanks you for your cooperation.<br/>\r\nThe evaluation report will be sent to your manager once the questionnaires were completed by all team members.<br/><br/>\r\n<a href=\\"http://survey.goforpeople.com/login.php?action=logout\\" class=\\"form-submit btn\\">Log out</a>'),
(14, 2, 'Your Team Assessment vous remercie pour votre collaboration.<br/>\r\nLe rapport dâ€™Ã©valuation sera transmis Ã  votre manager une fois les questionnaires remplis par tous les membres de lâ€™Ã©quipe.<br/><br/>\r\n<a href=\\"http://survey.goforpeople.com/login.php?action=logout\\" class=\\"form-submit btn\\">Se dÃ©connecter</a>'),
(14, 3, 'Your Team Assessment dankt je voor je medewerking.<br/>\r\nHet syntheserapport wordt bezorgd aan je leidinggevende van zodra alle teamleden de vragenlijsten hebben ingevuld.<br/><br/>\r\n<a href=\\"http://survey.goforpeople.com/login.php?action=logout\\" class=\\"form-submit btn\\">Log out</a>'),
(15, 1, '<p>Welcome on the  <strong>Your Team Assessment</strong> website, a team dynamics evaluation tool.</p>\r\n<p>You are a registered <strong>Your Team Assessment</strong> consultant and as such you can manage questionnaires and produce reports.</p>\r\n<p>In order to do so, you should enter your username and your password.</p>\r\n<p>Are you interested in becoming a registered <strong>Your Team Assessment</strong> consultant? If so, please contact us via our <a href="http://www.yourteamassessment.com/contact" target="_blank">contact page</a>.</p><br /><br />\r\n<p><strong>Go 4 People</strong>, 1A Bois du Foyau, 1440 Braine-le-ChÃ¢teau, <br />\r\n<a href="mailto:info@go4people.com">info@go4people.com</a> - TÃ©l : +32 (0)475 26 10 06</p>'),
(15, 2, '<p>Bienvenue sur le site <strong>Your Team Assessment</strong>, outil dâ€™Ã©valuation de la dynamique des Ã©quipes.</p>\r\n<p>Lâ€™agrÃ©ation Ã  lâ€™outil <strong>Your Team Assessment</strong> vous donne la possibilitÃ© de gÃ©rer des questionnaires et de produire des rapports.</p>\r\n<p>Pour cela, veuillez introduire votre identifiant et votre mot de passe.</p>\r\n<p>Si vous dÃ©sirez obtenir lâ€™agrÃ©ation, nous vous invitons Ã  prendre contact via la page <a href="http://www.yourteamassessment.com/contact" target="_blank">Contactez l''Ã©quipe</a> sur notre site web Your Team Assessment.</p><br /><br />\r\n<p><strong>Go 4 People</strong>, 1A Bois du Foyau, 1440 Braine-le-ChÃ¢teau, <br />\r\n<a href="mailto:info@go4people.com">info@go4people.com</a> - TÃ©l : +32 (0)475 26 10 06</p>'),
(15, 3, '<p>Welkom op de <strong>Your Team Assessment</strong>-website, een tool dat de dynamiek van teams evalueert.</p>\r\n<p>Je bent erkend <strong>Your Team Assessment</strong> consultant en in die hoedanigheid kan je vragenlijsten beheren en verslagen uitbrengen.</p>\r\n<p>Hiervoor dien je jouw gebruikersnaam en jouw paswoord aan te geven.</p>\r\n<p>Wil je erkend <strong>Your Team Assessment</strong> consultant worden? Neem dan gerust met ons contact op via onze <a href="http://www.yourteamassessment.com/contact" target="_blank">contactpagina</a>.</p><br /><br />\r\n<p><strong>Go 4 People</strong>, 1A Bois du Foyau, 1440 Braine-le-ChÃ¢teau, <br />\r\n<a href="mailto:info@go4people.com">info@go4people.com</a> - TÃ©l : +32 (0)475 26 10 06</p>'),
(16, 1, 'This means that the team lacks necessary levels of openness and vulnerability about individual strengths, weaknesses, mistakes and needs for help.'),
