(76, 1, '<p>This section provides a list of all teams within the same company.<br />\r\nOn this page the consultant can take the following actions:\r\n<ul>\r\n<li>Register as many teams as he/she wishes by clicking on the â€œNew team linkâ€ at the top of the page.</li>\r\n<li>Register as many team members as he/she wishes by clicking on the â€œList of membersâ€ link and then on the â€œAdd memberâ€ link on the page displayed on the screen.</li>\r\n<li>Select and order reports for one or different teams within the same company.</li>\r\n</ul>\r\n</p><br />\r\n<h4>How to order one or different reports?</h4><br />\r\n<p>As explained in the â€œCompany managementâ€ section, the consultant selects the team or teams for which he/she would like to order a report by ticking the box in the left-hand â€œOrder reportâ€ column. He/she validates his/her choice by clicking on the â€œGenerate report(s)â€ button.<br />\r\nOn the page displayed on the screen, he/she has the possibility to generate the report taking or not the team manager into account by ticking or not the box in front of the team managerâ€™s name.<br />\r\nOnce he/she has made his/her choice, the consultant clicks on the â€œNextâ€ button to access the secure online payment module (Paymill).<br />\r\nOnce the payment has been validated, the consultant is automatically redirected towards the â€œOrder and invoice managementâ€ section where he/she will be able to download his/her report(s) (in PDF format).</p>\r\n'),
(76, 2, '<p>Cette rubrique affiche la liste de toutes les Ã©quipes d\\''une sociÃ©tÃ©.<br />\r\nLe consultant peut effectuer les opÃ©rations suivantes Ã  partir de cette rubrique :\r\n<ul>\r\n<li>CrÃ©er autant d\\''Ã©quipes qu\\''il le souhaite en cliquant sur le lien \\"Nouvelle Ã©quipe\\" en haut de la page.</li>\r\n<li>CrÃ©er autant de membres qu\\''il le souhaite en cliquant sur le lien \\"Liste des membres\\" puis en cliquant sur le lien \\"Ajouter un membre\\" de la page qui s\\''affiche.</li>\r\n<li>SÃ©lectionner et commander les rapports pour une ou plusieurs Ã©quipes d\\''une mÃªme sociÃ©tÃ©</li>\r\n</ul>\r\n</p><br />\r\n<h4>Marche Ã  suivre pour commander un ou plusieurs rapports :</h4><br />\r\n<p>Comme expliquÃ© dans la rubrique \\"Gestion des SociÃ©tÃ©s\\", le consultant sÃ©lectionne l\\''Ã©quipe ou les Ã©quipes pour la(es)quelle(s) il dÃ©sire commander le rapport en cochant la case de la colonne de gauche \\"Commande de rapport\\". Il valide son choix en cliquant sur le bouton \\"GÃ©nÃ©rer le(s) rapport(s). <br />\r\nSur la page qui s\\''affiche, il a la possibilitÃ© de sortir le rapport avec ou sans le Team Manager en cochant ou non la case devant son nom.<br />\r\nAprÃ¨s avoir fait son choix, le consultant clique sur le bouton \\"Suivant\\" pour accÃ©der au module de paiement sÃ©curisÃ© en ligne (Paymill).<br />\r\nAprÃ¨s validation du paiement, le consultant est automatiquement redirigÃ© vers la section \\"Gestion des Commandes et Factures\\" oÃ¹ il pourra tÃ©lÃ©charger son ou ses rapports (au format PDF).</p>'),
(76, 3, '<p>Dit luik geeft de lijst weer van alle teams binnen een bedrijf.<br />\r\nVan hieruit kan de consultant de volgende acties uitvoeren:\r\n<ul>\r\n<li>Zoveel teams als gewenst aanmaken door te klikken op de link â€œNieuw teamâ€ bovenaan de pagina.</li>\r\n<li>Zoveel leden als gewenst toevoegen door te klikken op â€œLijst van ledenâ€ en daarna op de link â€œTeamlid toevoegenâ€ op de pagina die dan op het scherm verschijnt.</li>\r\n<li>Verslagen kiezen en bestellen voor Ã©Ã©n of meerdere teams van eenzelfde bedrijf.</li>\r\n</ul>\r\n</p><br />\r\n<h4>Hoe Ã©Ã©n of meerdere verslagen bestellen?</h4><br />\r\n<p>Zoals uitgelegd onder het luik â€œBeheer van bedrijvenâ€ selecteert de consultant het team of de teams waarvoor hij/zij een verslag wil bestellen. Hiervoor kruist hij/zij het vakje in de linkerkolom â€œVerslag bestellenâ€. Hij/Zij valideert zijn/haar keuze door te klikken op de knop â€œVerslag(en) aanmakenâ€.<br />\r\nOp de pagina die dan op het scherm verschijnt, kan hij/zij het verslag aanmaken met of zonder vermelding van de team manager. Hiervoor kruist hij/zij de naam van de team manager al dan niet aan.<br />\r\nNadat hij/zij zijn/haar keuze heeft gemaakt, klikt de consultant op de knop â€œVolgendeâ€ en krijgt hij/zij toegang tot de beveiligde online betalingsmodule (Paymill).<br />\r\nNa validatie van de betaling wordt de consultant automatisch doorverwezen naar het luik â€œBeheer van bestellingen en facturenâ€ waar hij/zij zijn/haar verslag(en) (in pdf-formaat) kan downloaden.</p>'),
