(90, 1, '<p>This section provides a list of all companies from one given consultant.<br />\r\nOn this page the consultant can take the following actions:\r\n<ul>\r\n<li>Register a new company by clicking on the â€œNew companyâ€ link at the top of the page. He/she will then be redirected towards the identification form in order to complete the form for this new company. He/she can also if necessary modify company data by clicking on the â€œeditâ€ link in the right-hand column of the table. He/she can also if necessary delete a company. Let us remind you that in that event all data relating to this particular company will be deleted as well.</li>\r\n<li>For each existing company, the consultant can register as many teams as he/she wishes by clicking on the â€œList of teamsâ€ link and then on the â€œNew teamâ€ link on the page displayed on the screen.</li>\r\n<li>For each existing team, the consultant can register as many team members as he/she wishes by clicking on the â€œList of membersâ€ and then on the â€œAdd memberâ€ link on the page displayed on the screen.</li>\r\n<li>Select and order reports for one or different teams within the same company.</li>\r\n</ul>\r\n		</p><br />\r\n		<h4>How to order one or different reports?</h4><br />\r\n<p>Once he/she has clicked on the â€œList of teamsâ€ link in the â€œCompany managementâ€ section, the consultant selects the team or teams for which he/she would like to order a report by ticking the box in the left-hand â€œOrder reportâ€ column. He/she validates his/her choice by clicking on the â€œGenerate report(s)â€ button.<br />\r\nOn the page displayed on the screen, he/she has the possibility to generate the report taking or not the team manager into account by ticking or not the box in front of the team managerâ€™s name.<br />\r\nOnce he/she has made his/her choice, the consultant clicks on the â€œNextâ€ button to access the secure online payment module (Paymill).<br />\r\nOnce the payment has been validated, the consultant is automatically redirected towards the â€œOrder and invoice managementâ€ section where he/she will be able to download his/her report(s) (in PDF format).\r\n</p>\r\n'),
(90, 2, '<p>Cette rubrique affiche la liste de toutes les sociÃ©tÃ©s d\\''un consultant.<br/>\r\n			Le consultant peut effectuer les opÃ©rations suivantes Ã  partir de cette rubrique :\r\n			<ul>\r\n				<li>CrÃ©er une nouvelle sociÃ©tÃ© en cliquant sur le lien \\"Nouvelle SociÃ©tÃ©\\" en haut de page. Il sera alors redirigÃ© vers la fiche signalÃ©tique Ã  complÃ©ter pour cette sociÃ©tÃ©. Il peut Ã©galement modifier les donnÃ©es de cette sociÃ©tÃ© si nÃ©cessaire, en cliquant sur le lien \\"Ã©diter\\" de la colonne de droite du tableau. Il peut aussi supprimer la sociÃ©tÃ© au besoin. Attention, dans ce cas, toutes les donnÃ©es liÃ©es Ã  cette sociÃ©tÃ© sont Ã©galement supprimÃ©es.</li>\r\n				<li>Pour chaque sociÃ©tÃ© existante, le consultant peut crÃ©er autant d\\''Ã©quipes qu\\''il le souhaite en cliquant sur le lien \\"Liste des Ã©quipes\\" puis en cliquant sur le lien \\"Nouvelle Ã©quipe\\" de la page qui s\\''affiche.</li>\r\n				<li>Pour chaque Ã©quipe existante, le consultant peut crÃ©er autant de membres qu\\''il le souhaite en cliquant sur le lien \\"Liste des membres\\" puis en cliquant sur le lien \\"Ajouter un membre\\" de la page qui s\\''affiche.</li>\r\n				<li>SÃ©lectionner et commander les rapports pour une ou plusieurs Ã©quipes d\\''une mÃªme sociÃ©tÃ©</li>\r\n			</ul>\r\n		</p><br />\r\n		<h4>Marche Ã  suivre pour commander un ou plusieurs rapports :</h4><br />\r\n		<p>	AprÃ¨s avoir cliquÃ© sur le lien \\"Liste des Ã©quipes\\" de la rubrique \\"Gestion des SociÃ©tÃ©s\\", le consultant sÃ©lectionne l\\''Ã©quipe ou les Ã©quipes pour la(es)quelle(s) il dÃ©sire commander le rapport en cochant la case de la colonne de gauche \\"Commande de rapport\\". Il valide son choix en cliquant sur le bouton \\"GÃ©nÃ©rer le(s) rapport(s). <br />\r\n			Sur la page qui s\\''affiche, il a la possibilitÃ© de sortir le rapport avec ou sans le Team Manager en cochant ou non la case devant son nom.<br />\r\n			AprÃ¨s avoir fait son choix, le consultant clique sur le bouton \\"Suivant\\" pour accÃ©der au module de paiement sÃ©curisÃ© en ligne (Paymill).<br />\r\n          	AprÃ¨s validation du paiement, le consultant est automatiquement redirigÃ© vers la section \\"Gestion des Commandes et Factures\\" oÃ¹ il pourra tÃ©lÃ©charger son ou ses rapports (au format PDF).\r\n    	</p>'),
(90, 3, '<p>Dit luik geeft de lijst weer van alle bedrijven van eenzelfde consultant.<br />\r\nVan hieruit kan de consultant de volgende acties uitvoeren:\r\n<ul>\r\n<li>Een nieuw bedrijf aanmaken door te klikken op de link â€œNieuw bedrijfâ€ bovenaan de pagina. Hij/Zij wordt dan doorverwezen naar de beschrijvingsfiche die hij/zij voor dit bedrijf zal moeten invullen. Hij/Zij kan ook gegevens van dit bedrijf zo nodig wijzigen door te klikken op de link â€œWijzigenâ€ in de rechterkolom van de tabel. Hij/Zij kan zo nodig ook een bedrijf verwijderen. Opgelet! In dat geval worden alle gegevens in verband met dat bedrijf eveneens verwijderd.</li>\r\n<li>Voor elk bestaand bedrijf kan de consultant zoveel teams als gewenst aanmaken door te klikken op de link â€œLijst van teamsâ€ en daarna op de link â€œNieuw teamâ€ van de pagina die dan op het scherm verschijnt.</li>\r\n<li>Voor elk bestaand team kan de consultant zoveel leden als gewenst aanmaken door te klikken op de link â€œLijst van teamledenâ€ en daarna op de link â€œTeamlid toevoegenâ€ van de pagina die dan op het scherm verschijnt.</li>\r\n<li>Verslagen voor Ã©Ã©n of meerdere teams van eenzelfde bedrijf selecteren en bestellen.</li>\r\n</ul>\r\n</p><br />\r\n		<h4>Hoe Ã©Ã©n of meerdere verslagen bestellen?</h4><br />\r\n<p>Nadat hij/zij op de link â€œLijst van teamsâ€ onder het luik â€œBeheer van bedrijvenâ€ heeft geklikt, selecteert de consultant het team of de teams waarvoor hij/zij een verslag wil bestellen. Hiervoor kruist hij/zij het vakje in de linkerkolom â€œVerslag bestellenâ€. Hij/Zij valideert zijn/haar keuze door te klikken op de knop â€œVerslag(en) aanmakenâ€. <br />\r\nOp de pagina die dan op het scherm verschijnt, kan hij/zij het verslag aanmaken met of zonder vermelding van de team manager. Hiervoor kruist hij/zij de naam van de team manager al dan niet aan. <br />\r\nNadat hij/zij zijn/haar keuze heeft gemaakt, klikt de consultant op de knop â€œVolgendeâ€ en krijgt hij/zij toegang tot de beveiligde online betalingsmodule (Paymill). <br />\r\nNa validatie van de betaling wordt de consultant automatisch doorverwezen naar het luik â€œBeheer van bestellingen en facturenâ€ waar hij/zij zijn/haar verslag(en) (in pdf-formaat) kan downloaden.\r\n</p>\r\n'),
