(105, 1, '<p>This section provides the list of all platform users (administrator or consultant).<br />\r\nIt is also on this page that administrators can add, delete or modify user data.<br />\r\nAccess rights to platform functionalities are determined according to the role allocated to users:<br />\r\n<ul>\r\n<li>Administrator: extended access to all platform functionalities.</li>\r\n<li>Consultant: limited access to the functionalities which are necessary to manage his/her clientele.</li>\r\n</ul>\r\nTo register a new user, click on the â€œNew userâ€ link at the top of the page.<br />\r\nTo edit user data or delete users, click on the â€œeditâ€ or â€œdeleteâ€ link in the last column of the table.\r\n</p>\r\n'),
(105, 2, '<p>Cette rubrique affiche la liste de tous les utilisateurs de la plateforme (administrateur ou consultant).<br />\r\n			C\\''est Ã©galement Ã  partir de cette page que les administrateurs peuvent ajouter, supprimer ou modifier les donnÃ©es des utilisateurs.<br />\r\n			Les droits d\\''accÃ¨s aux fonctionnalitÃ©s de la plateforme sont dÃ©terminÃ©s en fonction du rÃ´le attribuÃ© Ã  un utilisateur :<br />\r\n			<ul>\r\n			<li><strong>Administrateur :</strong> 	accÃ¨s Ã©tendu Ã  toutes les fonctionnalitÃ©s de la plateforme</li>\r\n			<li><strong>Consultant :</strong>		accÃ¨s restreint aux seules fonctionnalitÃ©s nÃ©cessaires Ã  la gestion de sa clientÃ¨le.</li>\r\n			</ul>\r\n			Pour crÃ©er un nouvel utilisateur, cliquer sur le lien \\"Nouvel utilisateur\\" en haut de page.<br />\r\n			Pour Ã©diter les donnÃ©es d\\''un utilisateur ou pour le supprimer, cliquer sur le lien \\"Ã©diter\\" ou \\"supprimer\\" dans la derniÃ¨re colonne du tableau.\r\n		</p>'),
(105, 3, '<p>Dit luik geeft de lijst weer van alle gebruikers van het platform (beheerder of consultant).<br />\r\nHet is ook vanuit deze pagina dat beheerders gegevens van gebruikers kunnen toevoegen, verwijderen of wijzigen.<br />\r\nDe rechten voor toegang tot de functionaliteiten van het platform hangen af van de rol die aan de gebruiker is toegekend:<br />\r\n<ul>\r\n<li><strong>Beheerder:</strong> uitgebreide toegang tot alle functionaliteiten van het platform.</li>\r\n<li><strong>Consultant:</strong> beperkte toegang tot de functionaliteiten die nodig zijn voor het beheer van zijn/haar klanten.</li>\r\n</ul>\r\nOm een nieuwe klant aan te maken, klik op de link â€œNieuwe gebruikerâ€ bovenaan de pagina.<br />\r\nOm gegevens van een gebruiker te wijzigen of te verwijderen, klik op de link â€œWijzigenâ€ of â€œVerwijderenâ€ in de laatste kolom van de tabel.\r\n</p>\r\n'),
