(109, 1, '<p>This section provides a list of all members within the same team.<br />\r\nIn this section the consultant can:\r\n<ul>\r\n<li>Add as many members to a team as he/she wishes by clicking on the â€œAdd memberâ€ link at the top of the page.</li>\r\n<li>Modify team member data by clicking on the â€œeditâ€ link in the right-hand column of the table.</li>\r\n<li>Delete members from a team by clicking on the â€œdeleteâ€ link in the right-hand column of the table.</li>\r\n<li>Reset all former results and start new assessment of the selected team by clicking on the â€œNew assessmentâ€ button at the bottom of the page.</li>\r\n</ul>\r\n</p><br />\r\n		<h4>Useful data on this page are :</h4><br />\r\n<p>Company and team name.<br />\r\nRole: the role allocated to each team member, i.e. team manager or member.<br />\r\nAnswer status: The number of questions to which a team member has answered. 35/35 means that the questionnaire has been fully completed.<br />\r\n</p>\r\n'),
(109, 2, '		<p>Cette rubrique affiche la liste de tous les membres qui composent une Ã©quipe.<br />\r\n			A partir de cette rubrique, le consultant peut :\r\n			<ul>\r\n				<li>Ajouter autant de membres qu\\''il le souhaite Ã  une Ã©quipe en cliquant sur le lien \\"Ajouter un membre\\" en haut de la page.</li>\r\n				<li>Modifier les donnÃ©es relatives Ã  un membre en cliquant sur le lien \\"Ã©diter\\" dans la colonne de droite du tableau.</li>\r\n				<li>Supprimer un membre d\\''une Ã©quipe en cliquant sur le lien \\"supprimer\\" dans la colonne de droite du tableau. </li>\r\n				<li>RÃ©initialiser les rÃ©sultats prÃ©cÃ©dents en vue de rÃ©aliser une nouvelle Ã©valuation pour l\\''Ã©quipe sÃ©lectionnÃ©e, en cliquant sur le bouton \\"Nouvelle Ã©valuation\\" en bas de page. </li>\r\n			</ul>\r\n		</p><br />\r\n		<h4>Les donnÃ©es utiles reprises sur cette page :</h4><br />\r\n		<p>	Le nom de la sociÃ©tÃ© et de l\\''Ã©quipe.<br />\r\n			RÃ´le : Le rÃ´le attribuÃ© Ã  chaque membre de l\\''Ã©quipe, Ã  savoir, team manager ou membre.<br />\r\n			Statut des rÃ©ponses : Le nombre de questions auxquelles un membre de l\\''Ã©quipe a rÃ©pondu.  35/35 signifie que le questionnaire a Ã©tÃ© complÃ¨tement rempli.<br />\r\n    	</p>'),
(109, 3, '<p>Dit luik geeft de lijst weer van alle leden die het team uitmaken.<br />\r\nVanuit dit luik kan de consultant: \r\n<ul>\r\n<li>Zoveel leden als gewenst aan een team toevoegen door te klikken op de link â€œTeamlid toevoegenâ€ bovenaan de pagina.</li>\r\n<li>Gegevens met betrekking tot een teamlid wijzigen door te klikken op de link â€œWijzigenâ€ in de rechterkolom van de tabel.</li>\r\n<li>Een teamlid uit een team verwijderen door te klikken op de link â€œVerwijderenâ€ in de rechterkolom van de tabel.</li>\r\n<li>Alle voorgaande resultaten verwijderen en nieuwe evaluatie starten voor het geselecteerde team door te klikken op de â€œNieuwe evaluatieâ€-knop onderaan de pagina.</li>\r\n</ul>\r\n		</p><br />\r\n<h4>Nuttige gegevens op deze pagina zijn:</h4><br />\r\n<p>Naam van het bedrijf en van het team.<br />\r\nRol: de rol die aan elk teamlid wordt toegekend, m.a.w. team manager of teamlid.<br />\r\nStatus van de antwoorden: het aantal vragen dat een teamlid heeft beantwoord. 35/35 betekent dat hij/zij de volledige vragenlijst heeft beantwoord.<br />\r\n</p>\r\n'),
