(124, 1, 'Display, add or modify companies, the teams of these companies and the members of these teams.<br />\r\nIt is also on this page that a consultant orders the reports of the various teams he/she is in charge of. <br />\r\nOnce he/she has selected the members (with or without taking into account the team manager) of the team or teams for which he/she would like a report, the consultant is automatically redirected towards the â€œOrder and invoice managementâ€ section where he/she makes his/her payment before being able to download his/her report(s) (in PDF format).'),
