(124, 3, 'Bedrijven die klant zijn, de teams van die bedrijven en de leden van die teams op het scherm tonen, toevoegen of wijzigen.<br />\r\nHet is ook vanuit deze pagina dat een consultant de verslagen bestelt van de verschillende teams waarmee hij/zij belast is.<br />\r\nNadat hij/zij de teamleden heeft geselecteerd (met inbegrip van of zonder de team manager) van het team of de teams waarvoor hij/zij een verslag wil ontvangen, wordt de consultant automatisch doorverwezen naar het luik â€œBeheer van bestellingen en facturenâ€ waar hij/zij de betaling zal verrichten alvorens het of de verslag(en) (in pdf-formaat) te kunnen downloaden.\r\n'),
