(162, 1, '<h4 class=\\"underline\\">Prices / Terms and Conditions</h4><br />\r\n<p>The report is available only via a registered consultant.\r\n<br /><br />\r\nThe price of the report invoiced to the consultant amounts to â‚¬135 (euro) excl. VAT.\r\n<br />\r\nThe recommended price to be invoiced to the client amounts to â‚¬200 (euro) excl. VAT, excluding provision of services.\r\n<br /><br />\r\nPrices are quoted exclusive of VAT at 21%.\r\n<br /><br />\r\n</p>\r\n\r\n<h4 class=\\"underline\\">Terms and Conditions</h4>\r\n<br />\r\n<p>\r\n<ol>\r\n<li>Use of the Your Team Assessment (hereinafter referred to as â€œYTAâ€) service is accessible only to registered consultants who have pre-registered for the service with Go4People SCRL (hereinafter referred to as â€œGo4People CCLLâ€ (cooperative company with limited liability)) and been allocated a password by it. Use of the service by a consultant implies that the latter agrees with the present conditions and therefore waives any general or specific conditions contained in its own purchase orders and invoices.</li>\r\n<br />\r\n<li>When a registered consultant requests a report on the screen of the YTA Report website, and then confirms its request, an order has been placed.</li>\r\n<br />\r\n<li>Orders cancelled after confirmation will not be refunded.</li>\r\n<br />\r\n<li>An order may be refused if Go4People CCLL has reasonable grounds to believe that it has not been placed by a bona fide registered consultant/user.</li>\r\n<br />\r\n<li>Owing to geographical restrictions, Go4People CCLL may refuse orders for the supply of certain questionnaires from registered users in certain countries. Further details can be supplied on request.</li>\r\n<br />\r\n<li>Go4People CCLL will use its reasonable endeavours to ensure that reports from the service are e-mailed to the registered user on the same day that the report is requested.</li>\r\n<br />\r\n<li>The report will be delivered immediately after payment via the method of payment listed on the website. Once payment is confirmed, an invoice will be sent.</li>\r\n<br />\r\n<li>Any claim or dispute must be sent by registered letter within 8 (eight) days after date of invoice to the aforementioned address of Go4People CCLL. Failure to pay an invoice when due will automatically and without prior notice lead to late-payment interest at the rate of 1.5% per month or part thereof for which payment is outstanding from the due date until the date of full payment. Go4People CCLL further reserves the right â€“ until full recovery and without prior notice â€“ to demand a lump sum amounting to 15% of the invoiced amount, with a minimum of â‚¬50 (fifty euro) of interest and of compensation and, without prejudice to any recovery fees, court costs and other fees that are charged to the defaulting debtor.</li>\r\n<br />\r\n<li>The consultant understands and acknowledges that in order to use the service certain technical requirements relating to hardware and software will need to be met. The consultant or any user designated by it agrees to abide by these requirements. Further details can be supplied on request.</li>\r\n<br />\r\n<li>The consultant shall not make use of data collected as a result of the use of the report for commercial sale or other commercial exploitation not agreed upon by YTA.</li>\r\n<br />\r\n<li>The consultant shall comply with the guidelines for the ethical use of tests and questionnaires.</li>\r\n<br />\r\n<li>If the consultant uses customisation facilities available on the service to be applied, it shall not alter or deviate from the standard supplied wording in relation to the content of e-mails sent by YTA. The consultant shall ensure that it possesses all necessary intellectual property rights or permissions and that any changes are lawful, appropriate and related to the subject matter of YTA. Go4People CCLL shall have no responsibility or liability in relation to any such customisation of the service, including any infringement of third party intellectual property rights, misuse, or unlawful or inappropriate content.</li>\r\n<br />\r\n<li>The consultant shall indemnify Go4people CCLL in the event of losses, claims, liabilities, damages, expenses or costs as a result (whether direct or indirect) of any breach by the purchaser or the registered user(s) in accordance with the provisions in article 5.</li>\r\n<br />\r\n<li>The consultant shall further indemnify Go4People CCLL in respect of any claims brought by a test-taker or client of the consultant against Go4People CCLL or its licensors in relation to the use of YTA and the order of the report.</li>\r\n<br />\r\n<li>All purchasers and registered consultants shall be required to verify and comply with any local requirements and/or restrictions on using psychometric tests in general and the keeping of data, whether imposed by law, regulation or any other regulatory body.</li>\r\n<br />\r\n<li>The questionnaire and the YTA report are owned by Go4People CCLL. Reproduction of the questionnaire or the YTA report, in whole or in part, in any form or media, by any process (including posting on the internet or any intranet, or unauthorised e-mailing), is prohibited except (i) where expressly permitted by law, or, (ii) where such reproduction is for the purposes of using the service in accordance with the present terms and conditions and with Go4People CCLLâ€™s agreement.v\r\n<br />\r\n<li>Reproduction of questionnaires available via the yourteamassessment.com website is not permitted, and the reports generated by the website may only be copied a reasonable number of times for internal record-keeping and other similar purposes related directly to the test-taker concerned.</li>\r\n<br />\r\n<li>All the data, personal and otherwise, that we collect as a result of the use of the questionnaire is handled in accordance with our privacy policy. The consultant agrees to comply with all legislation relating to personal data, as soon as it is in the possession of the YTA report.</li>\r\n<br />\r\n<li>Go4People CCLL does not accept any liability whatsoever for any direct or indirect damage, of any kind, when using the questionnaire and/or report in violation of the present terms and conditions.</li>\r\n<br />\r\n<li>For any litigation, even in the case of summary proceedings or introduction of third parties, the court of first instance of Nivelles has sole jurisdiction.</li>\r\n</ol>\r\n</p><br /><br />\r\n<h3 class=\\"with-tabs\\">Privacy Policy</h3>\r\n<br /><br /><br />\r\n<p>At Go 4 People, we place the highest importance on handling your personal data with respect and confidentiality. Accordingly, Go 4 People adheres to all applicable data protection laws and regulations. The following Privacy Policy outlines which data is collected from you and how it is handled. This policy applies to our product Your Team Assessment. Your Team Assessment is a product of Go 4 People scrl.</p>\r\nâ€¨<p>For questions about this privacy policy, you can write to us at any time via e-mailÂ <a href=Â« mailto:info@yourteamassessment.com Â»>info@yourteamassessment.com</a>Â or by mail:<br /><br />\r\nGo 4 People scrl<br />\r\nProtection des donnÃ©es de Your Team Assessment<br />\r\n18, Avenue AdÃ¨le<br />\r\n1310 La Hulpe<br />\r\nBelgique\r\n</p>\r\n<p>\r\n<strong>What Information is Stored and How is it Used?</strong><br />\r\nInformation you provide. In order to create your personal access to the backend of Your Team Assessment, it is necessary to specify the first and last name, the email address, telephone number and VAT number. The email address is used to send you notifications concerning your Your Team Assessment account. These include your login data and product-related information. At anytime, you have the right to unsubscribe from our platform by sending us an e-mail at : <a href=Â« mailto:info@yourteamassessment.com Â»>info@yourteamassessment.com</a>. For certain features, such as contact and payment details are required. This data will be stored only until you ask us to delete your Your Team Assessment account. </p>\r\n<p>\r\n<strong>Information on the usage of your Your Team Assessment account</strong><br />\r\nWhen you log into your Your Team Assessment, the Your Team Assessment server never collects data on how you use Your Team Assessment in what is known as an activity log.\r\n</p>\r\n<p>\r\n<strong>Storage of cookies on your computer</strong><br />\r\nCookies are tiny text files stored on your computer. Most frequently, cookies are stored for the duration of the current session, i.e. until you close your browser, but in some cases they are stored longer than this. \r\n</p>\r\n<p>\r\n<strong>We use cookies as follows:</strong><br />\r\nSession cookies for identification. When you sign into your Your Team Assessment, we automatically set a cookie to recognize your browser (this is called a session cookie). This allows you to enter your password only once per session (when you log in), without being asked repeatedly to do so while editing your Your Team Assessment. Most browsers accept cookies by default, but it is possible to change your browser settings to refuse all cookies. You can delete cookies at any time, however, but will have to sign in again the next time you want to access your Your Team Assessment area.\r\n</p>\r\n<p>\r\n<strong>Visibility and Publicly Accessible Information</strong><br />\r\nYour Your Team Assessment area . None of the information that you put on your Your Team Assessment can not be viewed by other Internet users.\r\n</p>\r\n\r\n<p>\r\n<strong>Administrative access to your Your Team Assessment area</strong><br />\r\nYour Team Assessment team members are authorized to access the administrative section of your Your Team Assessment area when fulfilling customer service requests and tracking errors. In such cases, they are able to view all parts of your Your Team Assessment, including all password-protected areas. All members of our team are regularly trained in privacy concerns and the confidentiality of data\r\n</p>\r\n\r\n<p>\r\n<strong>Sharing your Data</strong><br />\r\nYour information will never be sold to third parties. We will not disclose any personal data without your consent.\r\n</p>\r\n<p>\r\n<strong>Data Protection - personal data </strong><br />\r\nAccordance with the Law of 8 December 1992 on the protection of individuals with regard to the processing of personal data, the information requested is mandatory and necessary to the Service of Your Computer Assessment Team for the consideration of the establishment of a consultant account. <br /> \r\nA consultant has a right of access, opposition and rectification of data. <br /> \r\nAny request to access, rectification or opposition should be addressed to Go 4 People, 18 Avenue AdÃ¨le, 1310 La Hulpe, stating your full name and address.\r\n</p>'),
