(162, 3, '<h4 class=\\"underline\\">Tarieven en algemene voorwaarden</h4><br />\r\n<p>Het verslag is enkel verkrijgbaar via een erkend consultant.\r\n<br /><br />\r\nDe prijs van het verslag die aan de consultant wordt aangerekend, bedraagt 135 â‚¬ (euro) excl. btw.\r\n<br />\r\nDe aangeraden prijs voor facturering aan de klant bedraagt 200 â‚¬ (euro) excl. btw, dienstverlening niet inbegrepen.\r\n<br /><br />\r\nPrijzen zijn exclusief btw (21%).\r\n<br /><br />\r\n</p>\r\n\r\n<h4 class=\\"underline\\">Algemene voorwaarden</h4>\r\n<br />\r\n<p>\r\n<ol>\r\n<li>De Your Team Assessment-dienst (hier verder afgekort YTA) is enkel toegankelijk voor \r\nconsultants die vooraf door cvba Go4People werden erkend d.m.v. een paswoord dat hen werd toegekend. \r\nDoor gebruik te maken van deze dienst verklaart de consultant de huidige voorwaarden te onderschrijven \r\nen bijgevolg aan alle algemene of bijzondere voorwaarden vermeld in zijn eigen bestelbonnen \r\nen facturen te verzaken.</li>\r\n<br />\r\n\r\n<li>Wanneer een geregistreerde consultant op het scherm van de website YTA Report een \r\nverslag aanvraagt, betekent dit, na bevestiging, dat een bestelling werd geplaatst.</li>\r\n<br />\r\n<li>Bestellingen die na bevestiging worden geannuleerd, worden niet terugbetaald.</li>\r\n<br />\r\n<li>Een bestelling kan worden geweigerd als cvba Go4People gegronde redenen heeft om \r\nte denken dat de bestelling niet werd geplaatst door een te goeder trouw geregistreerde \r\nconsultant/gebruiker.</li>\r\n<br />\r\n<li>Vanwege geografische beperkingen behoudt cbva Go4People zich het recht voor om \r\n bestellingen voor het leveren van sommige vragenlijsten aan gebruikers die in sommige \r\n landen zijn geregistreerd, te weigeren. Verdere informatie hieromtrent is op aanvraag \r\n verkrijgbaar.</li>\r\n<br />\r\n<li>Cbva Go4People SCRL verbindt zich tot elke redelijke inspanning om ervoor te zorgen \r\n dat de verslagen per e-mail worden verzonden naar de geregistreerde gebruiker binnen 24 uur \r\n na aanvraag van het verslag.</li>\r\n\r\n<br />\r\n<li>Het verslag wordt afgeleverd onmiddellijk na betaling via de betalingswijze vermeld op de website. \r\nZodra de betaling is bevestigd, wordt een factuur opgemaakt en verstuurd.</li>\r\n\r\n<br />\r\n<li>Klachten en protesten dienen binnen de 8 (acht) kalenderdagen na factuurdatum per \r\naangetekend schrijven te worden meegedeeld aan cvba Go4People op hieronder vermeld adres. \r\nDoor het loutere feit van verstrijking van 30 dagen na factuurdatum zal van rechtswege en \r\nzonder enige ingebrekestelling wanbetaling vastgesteld zijn en zal een vertragingsinterest \r\nvan 1,5 % per begonnen maand verschuldigd zijn. Bovendien behoudt cbva Go4People zich \r\nhet recht voor â€“ tot dekking van alle schade â€“ lasten en kosten dan deze voortspruitende \r\nuit de enkele vertraging, een forfaitaire schadevergoeding van 15 % van het factuurbedrag \r\nverschuldigd zijn, met een minimum van 50 (vijftig) euro interesten en schadevergoeding \r\nverschuldigd en eisbaar zijn onverminderd eventuele invorderingskosten, gerechtskosten \r\nen andere uitvoeringskosten die ten laste zijn van de wanbetaler.</li>\r\n<br />\r\n\r\n<li>De consultant begrijpt en erkent dat het gebruik van de dienst aan bepaalde technische \r\nhardware- en softwarenormen voldoet. Deze normen dienen door de consultant of door iedere \r\ndoor hem aangewezen gebruiker te worden nageleefd. Verdere informatie hieromtrent is op \r\naanvraag verkrijgbaar.</li>\r\n<br />\r\n<li>De consultant ontzegt zich het recht gebruik te maken van gegevens verzameld als \r\ngevolg van het gebruik van het verslag voor de door YTA niet toegelaten commerciÃ«le verkoop \r\nof ander commercieel gebruik.</li>\r\n<br />\r\n<li>De consultant dient zich te houden aan de richtlijnen over het ethisch gebruik van \r\nde testen en vragenlijsten.</li>\r\n<br />\r\n<li>De consultant zal gebruikmaken van de mogelijkheden ter verpersoonlijking die \r\nbeschikbaar zijn op de toe te passen dienst. Hij ontzegt zich het recht de standaard \r\naangegeven formulering te wijzigen of ervan af te wijken in verhouding met de inhoud \r\nvan de door YTA gestuurde e-mails. De consultant dient zich ervan te vergewissen dat \r\nhij alle intellectuele eigendomsrechten of alle vergunningen bezit en dat elke wijziging \r\nwettelijk en aangewezen is, en betrekking heeft tot het onderwerp van YTA. Cbva Go4People \r\naanvaardt geen enkele aansprakelijkheid of verplichting wat betreft een soortgelijke \r\nverpersoonlijking van de dienst, inclusief iedere schending van intellectuele eigendomsrechten \r\nvan derden, misbruik of illegale of ongepaste inhoud.</li>\r\n<br />\r\n<li>De consultant zal cbva Go4People moeten vergoeden voor verliezen, protesten, \r\naansprakelijkheden, schade, uitgaven of kosten als (rechtstreeks of onrechtstreeks) \r\ngevolg van iedere nalatigheid van de geregistreerde koper of gebruiker volgens de bepalingen \r\nvan artikel 5.</li>\r\n<br />\r\n<li>De consultant zal bovendien cbva Go4People moeten vergoeden voor protesten van een \r\ntestgebruiker of een klant van de consultant tegen cbva Go4People of zijn licentiegevers \r\nover het gebruik van YTA en de bestelling van het verslag.</li>\r\n<br />\r\n<li>Alle kopers en geregistreerde consultants zijn verplicht de plaatselijke voorschriften \r\nen/of beperkingen op het gebruik van psychometrische testen in het algemeen en op het \r\nbijhouden van gegevens na te gaan en na te leven, of die nu door de wet, een reglement of \r\niedere andere reglementering worden opgelegd.</li>\r\n<br />\r\n\r\n<li>De YTA-vragenlijst en â€“verslag zijn eigendom van cvba Go4People. Elke reproductie, \r\ngeheel of gedeeltelijk, in welke vorm of op welke drager dan ook, met welk middel dan ook \r\n(inclusief het plaatsen op internet of ieder niet toegelaten intranet of e-mailingsysteem) \r\nis verboden, behalve (i) wanneer dit uitdrukkelijk door de wet is toegelaten; of (ii) \r\nwanneer de reproductie plaatsheeft in het kader van het gebruik van de dienst conform de \r\nhuidige algemene voorwaarden met instemming van cbva Go4People.</li>\r\n<br />\r\n<li>De reproductie van vragenlijsten beschikbaar op de website yourteamassessment.com is \r\nniet toegelaten, en de door de site gegenereerde verslagen mogen enkel een redelijk aantal \r\nkeren worden gekopieerd voor interne soortgelijke doeleinden, het bijhouden van dossiers \r\nen andere doeleinden die rechtstreeks verband houden met de betrokken test.</li>\r\n<br />\r\n\r\n<li>Alle persoonlijke gegevens, en ook de gegevens die wij verzamelen als gevolg van het \r\ngebruik van de vragenlijst worden conform ons privacybeleid behandeld. De consultant \r\nverbindt zich ertoe de wetgeving over persoonlijke gegevens na te leven, zodra hij in het \r\nbezit is van het YTA-verslag.</li>\r\n<br />\r\n\r\n<li>Cvba Go4People aanvaardt geen enkele aansprakelijkheid voor enige directe of indirecte \r\nschade, van welke aard dan ook, in geval van gebruik van de vragenlijst en/of het verslag \r\ndat in strijd is met de huidige algemene voorwaarden.</li>\r\n<br />\r\n\r\n<li>Voor alle geschillen, ook in geval van kortgeding of oproeping in vrijwaring, is \r\nuitsluitend de Rechtbank van Eerste Aanleg van Nijvel bevoegd.</li>\r\n</ol>\r\n</p>\r\n<br /><br /><br />\r\n<h3 class=\\"with-tabs\\">Privacy Verklaring</h3>\r\n<br /><br /><br />\r\n<p>Go 4 People hecht er veel waarde aan dat met persoonlijke gegevens verantwoordelijk wordt omgegaan. Alle bepalingen en wetten betreffende het recht op gegevensbescherming worden door Go 4 People nauwkeurig nageleefd. Hieronder wordt verklaard welke gegevens worden verzameld en hoe daarmee wordt omgegaan. Deze verklaring geldt voor het product Your Team Assessment. Your Team Assessment is een service van Go 4 People Scrl.</p>\r\n \r\n<p>Bij vragen over deze privacy verklaring kun je te allen tijde contact met ons opnemen via e-mail aan <a href=\\"mailto:info@yourteamassessment.com\\">info@yourteamassessment.com</a> of via de post:<br /><br />\r\nGo 4 People scrl<br />\r\nProtection des donnÃ©es de Your Team Assessment<br />\r\n18, Avenue AdÃ¨le<br />\r\n1310 La Hulpe<br />\r\nBelgique\r\n</p>\r\n<p>\r\n<strong>Welke informatie wordt verzameld en waarvoor wordt deze gebruikt?</strong><br />\r\nInformatie die door jou ter beschikking wordt gesteld. Bij het aanmaken van uw toegang tot ons management platform Your Team Assessment, vragen wij uw volledige naam, adres, telefoonnummer en BTW-nummer. Het emailadres wordt gebruikt om jou berichten betreffende Your Team Assessment te sturen (bijvoorbeeld het wachtwoord, waarmee je je voor de eerste keer op jouw Your Team Assessment kunt inloggen). Je kunt je te allen tijde afmelden voor onze platform door ons een e-mail naar <a href=\\"mailto:info@yourteamassessment.com\\">info@yourteamassessment.com</a>. Door bepaalde informatie, is het opvragen van verdere contact -en betaalgegevens noodzakelijk. Zo lang als je een gebruiker van Your Team Assessment, wordt de door u verstrekte informatie opgeslagen.\r\n</p>\r\n\r\n<p>\r\n<strong>Informatie over het gebruik van Your Team Assessment.</strong><br />\r\nWanneer u inlogt op uw site prive-ruimte, De servers van Your Team Assessment zal geen informatie opnemen, hoe je Your Team Assessment gebruiken.\r\n</p>\r\n\r\n<p>\r\n<strong>Het opslaan van cookies op je computer</strong><br />\r\nCookies zijn kleine tekstbestanden, die meestal voor de duur van de actuele sessie (dus tot het moment dat je jouw browser sluit, maar in enkele gevallen ook nog daarna) op je computer opgeslagen worden.\r\n</p>\r\n\r\n<p>\r\n<strong>Wij gebruiken cookies als volgt:</strong><br />\r\nIdentificatie door cookies. Zodra je je op jouw Your Team Assessment ruimte inlogt, plaatst Your Team Assessment automatisch een cookie ter identificatie van de browser (een zogenaamde \\"session cookie\\"). Daardoor hoef je tijdens de sessie het wachtwoord slechts Ã©Ã©n keer bij het inloggen in te voeren en word je bij het bewerken van de website niet herhaaldelijk daarom verzocht. De meeste browsers aanvaarden cookies, maar het is mogelijk je browser zo in te stellen dat deze alle cookies weigert. Je kunt cookies te allen tijde verwijderen, maar dan moet je je bij een volgende bezoek wel opnieuw inloggen.\r\n</p>\r\n\r\n<p>\r\n<strong>Toegang en publiek toegankelijke informatie</strong><br />\r\nUw ruimte Your Team Assessment. Geen van de informatie die is opgeslagen op uw plaats Your Team Assessment kan niet gelezen worden door andere gebruikers.</p>\r\n\r\n<p>\r\n<strong>Administratieve toegang tot jouw ruimte Your Team Assessment.</strong><br />\r\nHoud er rekening mee dat onze medewerkers toegang tot het administratieve gedeelte van uw ruimte uw team Assessment in de tracking after-sales service en bug kan hebben. Zo hebben ze toegang tot alle delen van uw ruimte, zoals de met een wachtwoord beschermde gebieden. Al onze medewerkers worden regelmatig op de hoogte van de bescherming van gegevens gemaakt en moeten voldoen.\r\n</p>\r\n\r\n<p>\r\n<strong>Doorgeven van jouw gegevens aan derden </strong><br />\r\nUw gegevens zullen niet worden verkocht aan een derde partij.</p>\r\n\r\n<p>\r\n<strong>Bescherming van uw persoonsgegevens</strong><br />\r\nOvereenstemming met de Wet van 8 december 1992 betreffende de bescherming van natuurlijke personen in verband met de verwerking van persoonsgegevens, de gevraagde informatie is verplicht en noodzakelijk om de dienst van de IT-afdeling van Your Team Assessment voor de behandeling van de oprichting van een consultant account. <br /> \r\nEen consultant heeft een recht van toegang, verzet en rectificatie van gegevens. <br /> \r\nElk verzoek tot toegang, verbetering of verzet moet worden gericht aan G4 4 People, 18 Avenue AdÃ¨le, 1310 La Hulpe, onder vermelding van uw volledige naam en adres.');
